import React from 'react';
import { NavLink } from 'react-router-dom';


const Home=()=> {
  return (
    
      <>
      <div className="container-fluid mb-auto">
          <div className="row">
              <div className="col-10 mx-auto  d-flex">
                  <div className="col-md-6 mt-5 order-2 order-lg-1 d-flex flex-column">
                      <h1>Welcome to Webi</h1>
                      <h2> we are here to help you</h2>
                      <NavLink to="/service" className="btn btn-primary">Get Started</NavLink>
                  </div>

              </div>
          </div>
      </div>
       
     
    </>
  );
}

export default Home;
